    # Write your code here
    dic ={}
    checked = []
    for i in range(len(arr)):
        if arr[i] not in checked:
            checked.append(arr[i])
            temp = 1
            for j in range(i+1,len(arr)):
                if arr[i]==arr[j]:
                    temp=temp+1    
            dic[str(arr[i])] = temp
    print(dic)
    print(checked)

    mf = None
    temp = 0
    for key in dic.keys():
        if dic.get(key) > temp:
            temp = dic.get(key)
            mf = key
        elif dic.get(key) == temp:
            if key < mf:
                mf = key
    return mf

